def whats_the_diff(packet_one, packet_two):
    if len(packet_one) != len(packet_two):
        print("They don't even have the same lengths bro! Packet 1 {} and packet 2 {}".format(len(packet_one), len(packet_two)))
    else:
        n = 2
        packet_one_bytes = [packet_one[i:i + n] for i in range(0, len(packet_one), n)]
        packet_two_bytes = [packet_two[i:i + n] for i in range(0, len(packet_two), n)]

        found = False
        for i in range(0, len(packet_one_bytes)):
            if not packet_one_bytes[i] == packet_two_bytes[i]:
                print("Difference at {} where packet one says {}, packet two says {}".format(i, packet_one_bytes[i], packet_two_bytes[i]))
                found = True

        if not found:
            print("They are the same")

        print("Finished")

whats_the_diff("", "")